
def list_parser(string):
    temp = string.split("), (")
    final = []
    for line in temp:
        line = line.strip("[]()")
        tup = line.split(", ")
        tup = list(map(float,tup))
        final.append(tuple(tup))
    return final

def string_divider(string, div):
    length = len(string)
    print(length)
    interval = length // div
    final = []
    for i in range(div):
        if i != div-1:
            print(interval * i,interval * (i + 1))
            final.append(string[interval * i: interval * (i + 1)])
        else:
            print("sdfsdg",len(string))
            print(interval * i, length)
            final.append(string[interval * i: length])

    return tuple(final)

